
CREATE TABLE Assets (
    assetnum VARCHAR(20) PRIMARY KEY,
    description VARCHAR(100),
    siteid VARCHAR(10),
    location VARCHAR(20),
    status VARCHAR(20),
    install_date DATE
);

CREATE TABLE Locations (
    location VARCHAR(20) PRIMARY KEY,
    description VARCHAR(100),
    siteid VARCHAR(10)
);

CREATE TABLE WorkOrders (
    wonum VARCHAR(20) PRIMARY KEY,
    assetnum VARCHAR(20),
    worktype VARCHAR(10),
    status VARCHAR(20),
    reportdate DATE,
    schedstart DATE,
    schedfinish DATE,
    actstart DATE,
    actfinish DATE,
    laborhrs DECIMAL(5,2),
    supervisor VARCHAR(50),
    crewid VARCHAR(20),
    siteid VARCHAR(10),
    istask BIT,
    parent VARCHAR(20),
    FOREIGN KEY (assetnum) REFERENCES Assets(assetnum)
);

