CREATE VIEW vw_MaintenanceWorkOrders AS
SELECT
    wo.wonum,
    wo.status,
    wo.worktype,
    wo.assetnum,
    a.description AS asset_description,
    a.location,
    l.description AS location_description,
    wo.reportdate,
    wo.schedstart,
    wo.schedfinish,
    wo.actstart,
    wo.actfinish,
    DATEDIFF(DAY, wo.reportdate, ISNULL(wo.actfinish, GETDATE())) AS work_age_days,
    wo.laborhrs,
    wo.supervisor,
    wo.crewid,
    wo.siteid
FROM WorkOrders wo
LEFT JOIN Assets a ON wo.assetnum = a.assetnum
LEFT JOIN Locations l ON a.location = l.location
WHERE wo.istask = 0 AND wo.parent IS NULL;

